PRAGMA foreign_keys=OFF;
CREATE TABLE `planned_exercises` (`id` integer PRIMARY KEY AUTOINCREMENT,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`workout_plan_id` integer,`name` text,CONSTRAINT `fk_workout_plans_exercises` FOREIGN KEY (`workout_plan_id`) REFERENCES `workout_plans`(`id`) ON DELETE CASCADE);
CREATE TABLE `planned_sets` (`id` integer PRIMARY KEY AUTOINCREMENT,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`planned_exercise_id` integer,`reps` integer,`weight` real,CONSTRAINT `fk_planned_exercises_sets` FOREIGN KEY (`planned_exercise_id`) REFERENCES `planned_exercises`(`id`) ON DELETE CASCADE);
CREATE TABLE `workout_plan_exercises` (`exercise_id` integer,`workout_plan_id` integer,PRIMARY KEY (`exercise_id`,`workout_plan_id`),CONSTRAINT `fk_workout_plan_exercises_exercise` FOREIGN KEY (`exercise_id`) REFERENCES `exercises`(`id`),CONSTRAINT `fk_workout_plan_exercises_workout_plan` FOREIGN KEY (`workout_plan_id`) REFERENCES `workout_plans`(`id`));
CREATE TABLE `workout_plans` (`id` integer PRIMARY KEY AUTOINCREMENT,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`name` text);
CREATE TABLE `exercises` (`id` integer PRIMARY KEY AUTOINCREMENT,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`name` text NOT NULL,`rep_rollover` integer);
CREATE TABLE `workout_logs` (`id` integer PRIMARY KEY AUTOINCREMENT,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`date` datetime,`workout_plan_id` integer,CONSTRAINT `fk_workout_logs_workout_plan` FOREIGN KEY (`workout_plan_id`) REFERENCES `workout_plans`(`id`));
CREATE TABLE `logged_exercises` (`id` integer PRIMARY KEY AUTOINCREMENT,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`workout_log_id` integer,`exercise_id` integer,`weight_setup` text,CONSTRAINT `fk_logged_exercises_exercise` FOREIGN KEY (`exercise_id`) REFERENCES `exercises`(`id`),CONSTRAINT `fk_workout_logs_exercises` FOREIGN KEY (`workout_log_id`) REFERENCES `workout_logs`(`id`) ON DELETE CASCADE);
CREATE TABLE `logged_sets` (`id` integer PRIMARY KEY AUTOINCREMENT,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`logged_exercise_id` integer,`reps` integer,`weight` real,CONSTRAINT `fk_logged_exercises_sets` FOREIGN KEY (`logged_exercise_id`) REFERENCES `logged_exercises`(`id`) ON DELETE CASCADE);
CREATE TABLE `cardios` (`id` integer PRIMARY KEY AUTOINCREMENT,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`workout_log_id` integer NOT NULL,`minutes` integer,`type` text,CONSTRAINT `fk_workout_logs_cardio` FOREIGN KEY (`workout_log_id`) REFERENCES `workout_logs`(`id`) ON DELETE CASCADE);
CREATE TABLE `plans` (`id` integer PRIMARY KEY AUTOINCREMENT,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`name` text,`calories` real,`protein` real,`fiber` real,`carbs` real);
CREATE TABLE `days` (`id` integer PRIMARY KEY AUTOINCREMENT,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`date` datetime,`plan_id` integer,CONSTRAINT `fk_days_plan` FOREIGN KEY (`plan_id`) REFERENCES `plans`(`id`));
CREATE TABLE `meals` (`id` integer PRIMARY KEY AUTOINCREMENT,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`name` text NOT NULL);
CREATE TABLE `foods` (`id` integer PRIMARY KEY AUTOINCREMENT,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`name` text NOT NULL,`serving_type` text NOT NULL,`serving_amount` real NOT NULL,`calories` real NOT NULL,`protein` real,`fiber` real,`carbs` real);
CREATE TABLE `meal_items` (`id` integer PRIMARY KEY AUTOINCREMENT,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`meal_id` integer NOT NULL,`food_id` integer NOT NULL,`amount` real,CONSTRAINT `fk_meal_items_food` FOREIGN KEY (`food_id`) REFERENCES `foods`(`id`),CONSTRAINT `fk_meals_items` FOREIGN KEY (`meal_id`) REFERENCES `meals`(`id`) ON DELETE CASCADE);
CREATE TABLE `saved_meals` (`id` integer PRIMARY KEY AUTOINCREMENT,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`name` text NOT NULL);
CREATE TABLE `saved_meal_items` (`id` integer PRIMARY KEY AUTOINCREMENT,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`saved_meal_id` integer NOT NULL,`food_id` integer NOT NULL,`amount` real,CONSTRAINT `fk_saved_meals_items` FOREIGN KEY (`saved_meal_id`) REFERENCES `saved_meals`(`id`) ON DELETE CASCADE,CONSTRAINT `fk_saved_meal_items_food` FOREIGN KEY (`food_id`) REFERENCES `foods`(`id`));
CREATE TABLE `planned_meals` (`id` integer PRIMARY KEY AUTOINCREMENT,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`day_id` integer NOT NULL,`meal_id` integer NOT NULL,`logged` numeric,CONSTRAINT `fk_days_planned_meals` FOREIGN KEY (`day_id`) REFERENCES `days`(`id`),CONSTRAINT `fk_planned_meals_meal` FOREIGN KEY (`meal_id`) REFERENCES `meals`(`id`));
CREATE TABLE `day_logs` (`id` integer PRIMARY KEY AUTOINCREMENT,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`day_id` integer NOT NULL,`meal_id` integer NOT NULL,CONSTRAINT `fk_day_logs_meal` FOREIGN KEY (`meal_id`) REFERENCES `meals`(`id`),CONSTRAINT `fk_days_logs` FOREIGN KEY (`day_id`) REFERENCES `days`(`id`));
